export function resolveApiConfig<Options extends ApiConfig & UserConfig>(
  options: Options,
  viteOverrides?: ViteUserConfig,
): ApiConfig | undefined {
  let api: ApiConfig | undefined
  if (options.api === true)
    api = { port: defaultPort }
  else if (typeof options.api === 'number')
    api = { port: options.api }

  if (typeof options.api === 'object') {
    if (api) {
      if (options.api.port)
        api.port = options.api.port

      if (options.api.strictPort)
        api.strictPort = options.api.strictPort

      if (options.api.host)
        api.host = options.api.host
    }
    else {
      api = { ...options.api }
    }
  }

  if (api) {
    if (!api.port)
      api.port = defaultPort

    if (viteOverrides)
      viteOverrides.server = Object.assign(viteOverrides.server || {}, api)
  }

  return api
}

export function resolveConfig(
  options: UserConfig,
  viteConfig: ResolvedViteConfig,
): ResolvedConfig {
  if (options.dom)
    options.environment = 'happy-dom'

  const resolved = {
    ...deepMerge(options, viteConfig.test || {}),
    root: viteConfig.root,
  } as ResolvedConfig

  if (viteConfig.base !== '/')
    resolved.base = viteConfig.base

  resolved.coverage = resolveC8Options(resolved.coverage, resolved.root)

  resolved.depsInline = [...resolved.deps?.inline || []]
  resolved.depsExternal = [...resolved.deps?.external || []]
  resolved.fallbackCJS = resolved.deps?.fallbackCJS ?? true
  resolved.interpretDefault = resolved.deps?.interpretDefault ?? true

  resolved.environment = resolved.environment || 'node'
  resolved.threads = resolved.threads ?? true

  resolved.clearMocks = resolved.clearMocks ?? false
  resolved.restoreMocks = resolved.restoreMocks ?? false
  resolved.mockReset = resolved.mockReset ?? false

  resolved.include = resolved.include ?? defaultInclude
  resolved.exclude = resolved.exclude ?? defaultExclude

  resolved.testTimeout = resolved.testTimeout ?? 5_000
  resolved.hookTimeout = resolved.hookTimeout ?? 10_000

  resolved.isolate = resolved.isolate ?? true

  resolved.testNamePattern = resolved.testNamePattern
    ? resolved.testNamePattern instanceof RegExp
      ? resolved.testNamePattern
      : new RegExp(resolved.testNamePattern)
    : undefined

  resolved.watchIgnore = resolved.watchIgnore ?? [/\/node_modules\//, /\/dist\//]

  const CI = !!process.env.CI
  const UPDATE_SNAPSHOT = resolved.update || process.env.UPDATE_SNAPSHOT
  resolved.snapshotOptions = {
    updateSnapshot: CI && !UPDATE_SNAPSHOT
      ? 'none'
      : UPDATE_SNAPSHOT
        ? 'all'
        : 'new',
  }

  if (process.env.VITEST_MAX_THREADS)
    resolved.maxThreads = parseInt(process.env.VITEST_MAX_THREADS)

  if (process.env.VITEST_MIN_THREADS)
    resolved.minThreads = parseInt(process.env.VITEST_MIN_THREADS)

  resolved.setupFiles = Array.from(resolved.setupFiles || [])
    .map(i => resolve(resolved.root, i))

  // the server has been created, we don't need to override vite.server options
  resolved.api = resolveApiConfig(options)

  if (options.related)
    resolved.related = toArray(options.related).map(file => resolve(resolved.root, file))

  return resolved
}
import type { TransformResult } from 'vite'
import { toFilePath } from '../utils'
import type { Vitest } from './index'

const promiseMap = new Map<string, Promise<TransformResult | null | undefined>>()

export async function transformRequest(ctx: Vitest, id: string) {
  // reuse transform for concurrent requests
  if (!promiseMap.has(id)) {
    promiseMap.set(id,
      _transformRequest(ctx, id)
        .then((r) => {
          promiseMap.delete(id)
          return r
        }),
    )
  }
  return promiseMap.get(id)
}

async function _transformRequest(ctx: Vitest, id: string) {
  let result: TransformResult | null = null

  if (id.match(/\.(?:[cm]?[jt]sx?|json)$/)) {
    result = await ctx.server.transformRequest(id, { ssr: true })
  }
  else {
    // for components like Vue, we want to use the client side
    // plugins but then covert the code to be consumed by the server
    result = await ctx.server.transformRequest(id)
    if (result)
      result = await ctx.server.ssrTransform(result.code, result.map, id)
  }

  if (result && !id.includes('node_modules'))
    withInlineSourcemap(result)

  if (result?.map && process.env.NODE_V8_COVERAGE)
    ctx.visitedFilesMap.set(toFilePath(id, ctx.config.root), result.map as any)

  // TODO: cache this result based on Vite's module graph
  return result
}

let SOURCEMAPPING_URL = 'sourceMa'
SOURCEMAPPING_URL += 'ppingURL'

export async function withInlineSourcemap(result: TransformResult) {
  const { code, map } = result

  if (code.includes(`${SOURCEMAPPING_URL}=`))
    return result
  if (map)
    result.code = `${code}\n\n//# ${SOURCEMAPPING_URL}=data:application/json;charset=utf-8;base64,${Buffer.from(JSON.stringify(map), 'utf-8').toString('base64')}\n`

  return result
}
